import React from 'react'
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';


export default function SelfService() {
    return (
        <Card style={{ width: '22rem' }}>
          <Card.Body style={{backgroundColor:'lightcoral'}}>
            <Card.Title style={{textAlign:'center'}}><h1>Self Service</h1></Card.Title>
            <Card.Text style={{marginLeft:20}}>
                <Card.Img variant="top" src="https://c8.alamy.com/comp/G54W1F/people-help-themselves-to-food-at-a-self-service-buffet-at-a-party-G54W1F.jpg" height={300} width={300}/>
          
              <h2>&nbsp;&nbsp;&nbsp;&nbsp; In self-service customers order and pay for their food at a 
            counter and serve themselves. This type of service is common in 
            fast-food restaurants. </h2>
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
      );
}
